prep:
  code: |
    <code xmlns="http://xgridfit.sourceforge.net/Xgridfit2">
      <enable-instructions/>
      <if test="pixels-per-em &gt; 300">
        <disable-instructions/>
      </if>
      <push>4 511</push>
      <command name="SCANCTRL"/>
      <command name="SCANTYPE"/>
      <if test="pixels-per-em &lt; 40">
        <set-control-value name="xheight-overshoot" unit="pixel" value="control-value(xheight)"/>
        <set-control-value name="lc-baseline-undershoot" unit="pixel" value="control-value(baseline)"/>
      </if>
      <if test="pixels-per-em &lt; 144">
        <set-control-value name="cap-serif-overshoot" unit="pixel" value="control-value(cap-serif-undershoot)"/>
        <set-control-value name="u-top-a" unit="pixel" value="control-value(xheight)"/>
        <set-control-value name="u-top-b" unit="pixel" value="control-value(xheight)"/>
      </if>
    </code>
functions:
  serif-helper:
    stack-safe: true
    base:
      type: point
      subtype: target
    pt-a:
      type: point
      subtype: target
    base-cv:
      val: baseline
      type: pos
    cup-cv:
      val: cap-baseline-undershoot
      type: dist
    ppem:
      type: int
      val: 190
    code: |
      <code xmlns="http://xgridfit.sourceforge.net/Xgridfit2">
        <move distance="base-cv">
          <point num="base"/>
        </move>
        <if test="pixels-per-em &lt; ppem">
          <align>
            <point num="pt-a"/>
          </align>
          <else>
            <command name="RTDG"/>
            <move distance="cup-cv">
              <reference>
                <point num="base"/>
              </reference>
              <point num="pt-a"/>
            </move>
            <command name="RTG"/>
          </else>
        </if>
      </code>
  align-or-shift:
    stack-safe: true
    primitive: true
    ppem:
      type: int
      val: 43
    r:
      type: point
      subtype: ref
    p:
      type: point
      subtype: target
    code: |
      <code xmlns="http://xgridfit.sourceforge.net/Xgridfit2">
        <command name="MPPEM"/>
        <command name="GT"/>
        <command name="IF"/>
        <command name="SRP0"/>
        <command name="ALIGNRP"/>
        <command name="ELSE"/>
        <command name="SRP1"/>
        <command name="SHP" modifier="1"/>
        <command name="EIF"/>
      </code>
